import { browser, $, $$, expect } from '@wdio/globals';

describe('first test', async function() {
    it('first click test', async function() {
       // browser.url('https://webdriver.io/');

        const Selectors = {
            login: {
                android: `~Login`,
                //web: `//*[@name="username"]`,
                web: `//a[contains(text(),'Get Started')]`,
            } ,
    };

        await (await $(Selectors.login)).isDisplayed();
        await $(Selectors.login).click();
        await browser.pause(5000);

    });
});

