import { browser, $, $$, expect } from '@wdio/globals';
// import { AppiumDriver } from 'appium/build/lib/appium';

const platformKeyMap = {
    web: 'web',
    android: 'android',
};

browser.overwriteCommand('$', async ($, selector) => {
    let ele;

    if(typeof selector === 'string') {
        ele = $(selector);
    }
    else {
      ele = $(getSelectorByPlatform(selector));    //$(Selectors.login[web])
    }
    return ele;
});

function getSelectorByPlatform(selector) {
    const platform = getPlatform();                              //const platform = web
    const platformKey = validatAndGetPlatformKey(platform);      //const platformKey = web
    return selector[platformKey];                                //Selectors.login[web]
};

function getPlatform() {
    if(!driver.isMobile) return 'web';
    else return 'android';
}

function validatAndGetPlatformKey(platform) {
    return platformKeyMap[platform];
}

