import { $ } from "webdriverio/build/commands/browser";

const Selectors = {
    // webview: {
    //     android: `~WebView`,
    // },

    getStarted: {
        // android: `//*[contains(@text, "Get Started")]`,
        android: `~WebView`,
        web: `//a[contains(text(),'Get Started')]`,
    }
};

class homePage {
    async getStarted() {
        // await (await $(Selectors.webview)).isDisplayed();
        // await (await $(Selectors.webview)).click();
        await (await $(Selectors.getStarted)).isDisplayed();
        await $(Selectors.getStarted).click();
        await browser.pause(5000);
    }
}

